        [HttpPost]
        public JsonResult VerificarZonaPreferencial(string codigoPais, string latitud, string longitud)
        {
            if (codigoPais != "CO")
                return Json(new { EsZonaPreferencial = false });

            if (Session["ResultadoZona"] != null)
            {
                var codigoRegion = Session["ResultadoZona"].ToString().Substring(0, 2);
                return Json(new { EsZonaPreferencial = codigoRegion == "24" });
            }

            var resultadoGeo = BaseUtilities.ConsumirServicio("/ObtenerTerritorioPorPunto", new
            {
                punto = new { latitud, longitud },
                pais = codigoPais,
                aplicacion = 1
            }).SelectToken("ObtenerTerritorioPorPuntoResult");

            if (resultadoGeo.HasValues &&
                resultadoGeo.SelectToken("MensajeRespuesta").ToObject<string>() == Enumeradores.EstadoGEO.OK.ToString())
            {
                var resultado = resultadoGeo.SelectToken("Resultado").ToObject<string>();
                var codigoRegion = resultado.Substring(0, 2);

                return Json(new { EsZonaPreferencial = codigoRegion == "24" });
            }

            return Json(new { EsZonaPreferencial = true });
        }

        public JsonResult GenerarRfc(RfcParameter parametro)
        {
            using (var validacionesUnete = new ValidacionesUneteClient())
            {
                var respuestaServicio = validacionesUnete.ConstruirRfc(parametro);
                return Json(new { Rfc = respuestaServicio.RfcNumber });
            }
        }
